import React from 'react';
import { Modal, Button } from 'react-bootstrap';

const EditBusModal = ({ show, onHide, groupData, onBusUpdated }) => {
  return (
    <Modal show={show} onHide={onHide}>
      <Modal.Header closeButton>
        <Modal.Title>Editar Bus</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        {/* Implementa el formulario de edición de bus */}
        <p>Formulario de edición de bus (por implementar).</p>
      </Modal.Body>
      <Modal.Footer>
        <Button variant="secondary" onClick={onHide}>Cerrar</Button>
        <Button variant="primary" onClick={() => onBusUpdated({ company_name: 'Bus Nuevo', bus_code: 'ABC123'})}>Guardar</Button>
      </Modal.Footer>
    </Modal>
  );
};

export default EditBusModal;
